import React from 'react';
import styled from 'styled-components';

const StyledButton = styled.button`
  border: none;
  border-radius: 4px;
  padding: 0.25rem 1rem;
  outline: none;
  cursor: pointer;

  background: ${palette.cyan[7]};
  &:hover {
    background: ${palette.gray[5]};
  }
`;

const Button = () => {
  return <></>;
};
export default Button;
